import { Input } from '@progress/kendo-react-inputs';

interface ShowPasswordProps {
  password: string
}
const ShowPassword = ({ 
  password = '',
}: ShowPasswordProps) => {
  return (
    <div className="flex items-center border-b-2 border-yellow-500 py-2 mt-1">
      <Input
        className="text-center appearance-none bg-transparent border-none w-full text-black 
        text-3xl mr-3 py-1 px-2 leading-tight 
        focus:outline-none"
        type="password"
        readOnly={true}
        value={password}

        maxLength={6}        
      />
    </div>
  )
}


export default ShowPassword
